import React, { Component } from 'react'
import TodoItem from "./TodoItem";

export default class TodosList extends Component {

    render() {
        const { todos } = this.props;

        return (
            <div>
                {todos.map(todo => (
                    <li key={todo.id}>{todo.title}</li>
                ))}
            </div>
        )
    }
}
